import {
  View,
  Text,
  Button,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  Image,
} from "react-native";
import React, { useState } from "react";
import * as WebBrowser from "expo-web-browser";

import {
  BannerAd,
  BannerAdSize,
  TestIds,
} from "react-native-google-mobile-ads";

const adUnitId = __DEV__
  ? TestIds.BANNER
  : "ca-app-pub-8686062104433125/8511852168";

const imageWA =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FWA.png?alt=media&token=5c62ff0a-7b78-498c-8912-79f551428c28";
const imageNT =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FNT.png?alt=media&token=372604a3-1c5b-4722-b96a-0f1e8f264c4c";
const imageQLD =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FQLD.png?alt=media&token=c591370a-fdba-46e9-8dc0-9c19f6984455";
const imageSA =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FSA.png?alt=media&token=214d89fd-2bb1-47e5-b139-874fbb957002";
const imageNSW =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FNSW.png?alt=media&token=013fc89d-3e44-401d-a101-d4ec19983f3e";
const imageVIC =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FVIC.png?alt=media&token=a3a63cb9-bc69-454f-b966-9643232c6b64";
const imageTAS =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FTAS.png?alt=media&token=10c7ae1c-b08c-47e9-b3c6-86bad090f979";
const imageACT =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FACT_Circled.png?alt=media&token=886ceef0-e216-42eb-bd0c-c3935a14c2a2";

const ExploreAustraliaScreen = () => {
  const [state, setState] = useState(true);
  const [checkedWA, setCheckedWA] = useState(false);
  const [checkedNT, setCheckedNT] = useState(false);
  const [checkedQLD, setCheckedQLD] = useState(false);
  const [checkedSA, setCheckedSA] = useState(false);
  const [checkedNSW, setCheckedNSW] = useState(false);
  const [checkedVIC, setCheckedVIC] = useState(false);
  const [checkedTAS, setCheckedTAS] = useState(false);
  const [checkedACT, setCheckedACT] = useState(false);

  return (
    <View>
      <View style={{ alignItems: "center" }}>
        <BannerAd unitId={adUnitId} size={BannerAdSize.BANNER} />
      </View>
      <ScrollView>
        <Text
          style={{ fontSize: 26, marginHorizontal: 20, marginVertical: 20 }}
        >
          Explore Australia before you start your journey
        </Text>

        <View style={{ marginVertical: 20 }}>
          <View style={{ justifyContent: "center", flexDirection: "row" }}>
            {/* WA */}
            {checkedWA != true ? (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(true),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(false),
                ]}
              >
                <Image
                  source={{
                    uri: imageWA,
                  }}
                  style={styles.uncheckedWA}
                />
              </TouchableOpacity>
            ) : (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(true),
                ]}
              >
                <Image
                  source={{
                    uri: imageWA,
                  }}
                  style={[styles.uncheckedWA, styles.checkedState]}
                />
              </TouchableOpacity>
            )}

            {/* NT */}
            {checkedNT != true ? (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(true),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(false),
                ]}
              >
                <Image
                  source={{
                    uri: imageNT,
                  }}
                  style={styles.uncheckedNT}
                />
              </TouchableOpacity>
            ) : (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(true),
                ]}
              >
                <Image
                  source={{
                    uri: imageNT,
                  }}
                  style={[styles.uncheckedNT, styles.checkedState]}
                />
              </TouchableOpacity>
            )}

            {/* QLD */}
            {checkedQLD != true ? (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(true),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(false),
                ]}
              >
                <Image
                  source={{
                    uri: imageQLD,
                  }}
                  style={styles.uncheckedQLD}
                />
              </TouchableOpacity>
            ) : (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(true),
                ]}
              >
                <Image
                  source={{
                    uri: imageQLD,
                  }}
                  style={[styles.uncheckedQLD, styles.checkedState]}
                />
              </TouchableOpacity>
            )}
          </View>

          <View
            style={{
              justifyContent: "center",
              flexDirection: "row",
              marginLeft: 102,
              marginTop: -90,
            }}
          >
            {/* SA */}
            {checkedSA != true ? (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(true),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(false),
                ]}
              >
                <Image
                  source={{
                    uri: imageSA,
                  }}
                  style={styles.uncheckedSA}
                />
              </TouchableOpacity>
            ) : (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(true),
                ]}
              >
                <Image
                  source={{
                    uri: imageSA,
                  }}
                  style={[styles.uncheckedSA, styles.checkedState]}
                />
              </TouchableOpacity>
            )}

            <View>
              {/* NSW */}
              {checkedNSW != true ? (
                <TouchableOpacity
                  onPress={() => [
                    setCheckedWA(false),
                    setCheckedNT(false),
                    setCheckedQLD(false),
                    setCheckedSA(false),
                    setCheckedNSW(true),
                    setCheckedVIC(false),
                    setCheckedTAS(false),
                    setCheckedACT(false),
                    setState(false),
                  ]}
                >
                  <Image
                    source={{
                      uri: imageNSW,
                    }}
                    style={styles.uncheckedNSW}
                  />
                </TouchableOpacity>
              ) : (
                <TouchableOpacity
                  onPress={() => [
                    setCheckedWA(false),
                    setCheckedNT(false),
                    setCheckedQLD(false),
                    setCheckedSA(false),
                    setCheckedNSW(false),
                    setCheckedVIC(false),
                    setCheckedTAS(false),
                    setCheckedACT(false),
                    setState(true),
                  ]}
                >
                  <Image
                    source={{
                      uri: imageNSW,
                    }}
                    style={[styles.uncheckedNSW, styles.checkedState]}
                  />
                </TouchableOpacity>
              )}

              {/* VIC */}
              {checkedVIC != true ? (
                <TouchableOpacity
                  onPress={() => [
                    setCheckedWA(false),
                    setCheckedNT(false),
                    setCheckedQLD(false),
                    setCheckedSA(false),
                    setCheckedNSW(false),
                    setCheckedVIC(true),
                    setCheckedTAS(false),
                    setCheckedACT(false),
                    setState(false),
                  ]}
                >
                  <Image
                    source={{
                      uri: imageVIC,
                    }}
                    style={styles.uncheckedVIC}
                  />
                </TouchableOpacity>
              ) : (
                <TouchableOpacity
                  onPress={() => [
                    setCheckedWA(false),
                    setCheckedNT(false),
                    setCheckedQLD(false),
                    setCheckedSA(false),
                    setCheckedNSW(false),
                    setCheckedVIC(false),
                    setCheckedTAS(false),
                    setCheckedACT(false),
                    setState(true),
                  ]}
                >
                  <Image
                    source={{
                      uri: imageVIC,
                    }}
                    style={[styles.uncheckedVIC, styles.checkedState]}
                  />
                </TouchableOpacity>
              )}
            </View>
          </View>

          <View style={{ alignItems: "flex-end" }}>
            {/* TAS */}
            {checkedTAS != true ? (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(true),
                  setCheckedACT(false),
                  setState(false),
                ]}
              >
                <Image
                  source={{
                    uri: imageTAS,
                  }}
                  style={styles.uncheckedTAS}
                />
              </TouchableOpacity>
            ) : (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(true),
                ]}
              >
                <Image
                  source={{
                    uri: imageTAS,
                  }}
                  style={[styles.uncheckedTAS, styles.checkedState]}
                />
              </TouchableOpacity>
            )}
            {/*ACT */}
            {checkedACT != true ? (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(true),
                  setState(false),
                ]}
              >
                <Image
                  source={{
                    uri: imageACT,
                  }}
                  style={styles.uncheckedACT}
                />
              </TouchableOpacity>
            ) : (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(true),
                ]}
              >
                <Image
                  source={{
                    uri: imageACT,
                  }}
                  style={[styles.uncheckedACT, styles.checkedState]}
                />
              </TouchableOpacity>
            )}
          </View>
        </View>

        {state && (
          <View>
            <View
              style={[styles.listContainer, { backgroundColor: "#1267E9" }]}
            >
              <Text
                style={{
                  fontSize: 18,
                  marginHorizontal: 20,
                  marginVertical: 10,
                  color: "white",
                }}
              >
                Select a state from the above map to start exploring
              </Text>
            </View>
            <View style={styles.listContainer}>
              <Text style={{ fontSize: 20, margin: 10 }}>Australia</Text>
              <Text style={styles.detailsText}>Capital city: Canberra</Text>
              <Text style={styles.detailsText}>Population: 25,688,079</Text>
              <Text style={styles.detailsText}>Land area: 7,692 024 km2</Text>
              <Text style={styles.detailsText}>
                People born overseas: 29.8%
              </Text>
              <Text style={styles.detailsText}>
                People speaking non-English language at home: 23%
              </Text>
              <View style={{ alignItems: "center", marginTop: 20 }}>
                <BannerAd unitId={adUnitId} size={BannerAdSize.BANNER} />
              </View>

              <Image
                source={{
                  uri: "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/data%2FmajorCities_AUS.png?alt=media&token=48fe2079-0353-40f9-8503-092d146a7242",
                }}
                style={{
                  height: 300,
                  width: "100%",
                  resizeMode: "contain",
                  marginVertical: 10,
                }}
              />

              <TouchableOpacity
                style={styles.moreButton}
                onPress={() =>
                  WebBrowser.openBrowserAsync(
                    "https://en.wikipedia.org/wiki/Australia"
                  )
                }
              >
                <Text
                  style={{ fontSize: 18, color: "#1267E9", fontWeight: "bold" }}
                >
                  Explore more
                </Text>
              </TouchableOpacity>
              <View style={{ alignItems: "center", marginBottom: 50 }}>
                <BannerAd unitId={adUnitId} size={BannerAdSize.LARGE_BANNER} />
              </View>
            </View>
          </View>
        )}

        {/* ///////////////////// NSW //////////////////////////////// */}
        {checkedNSW && (
          <View>
            <View
              style={[styles.listContainer, { backgroundColor: "#1267E9" }]}
            >
              <Text style={styles.stateHeading}>New South Wales</Text>
            </View>
            <View style={styles.listContainer}>
              {/* <Text style={styles.detailsText}>Major city: Sydney</Text> */}
              <Text style={styles.detailsText}>Population: 8,172,500</Text>
              <Text style={styles.detailsText}>Land area: 801,150 sq. km</Text>
              <Text style={styles.detailsText}>
                People born overseas: 29.3%
              </Text>
              <Text style={styles.detailsText}>
                People speaking non-English language at home: 26.6%
              </Text>
              <View style={{ alignItems: "center", marginTop: 20 }}>
                <BannerAd unitId={adUnitId} size={BannerAdSize.BANNER} />
              </View>
              <Image
                source={{
                  uri: "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/data%2FmajorCities_NSW.png?alt=media&token=48bb9b76-3071-4b96-a857-8dc11cc5e760",
                }}
                style={{
                  height: 300,
                  width: "100%",
                  resizeMode: "contain",
                  marginVertical: 10,
                }}
              />

              <TouchableOpacity
                style={styles.moreButton}
                onPress={() =>
